        <div><h1 style={{marginTop:'3rem',marginBottom:'2rem'}}>Stadium Name</h1>
      <img src="defaultStadium.jpg"></img>
      <h3>Governorate</h3>
      <h4>City</h4>
      <hr/>
      <h2>Day Slots</h2></div>
      
      {Array(7)
        .fill(null)
        .map((el, i) => (
          <DaySlot key={i}/>
        ))}
    </div>
  );
};

export default Stadium;
